import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import NavBar from './components/NavBar';
import PhoneticsList from './components/PhoneticsList';
import ExampleOfPhonetic from './components/ExampleOfPhonetic';
function App() {
  return (
    <div className="App">
         <BrowserRouter>
    <Switch>
      <Route exact path="/">
        <PhoneticsList/>
      </Route>
      <Route exact path="/examples/:name">
        <ExampleOfPhonetic/>
      </Route>
    </Switch>
    </BrowserRouter>  
    </div>
  );
}

export default App;
